CREATE TABLE IF NOT EXISTS `b_twpx_yadelivery_config`(
    `CODE` VARCHAR(50) NOT NULL,
    `VALUE` TEXT,
    PRIMARY KEY(`CODE`)
); 

CREATE TABLE IF NOT EXISTS `b_twpx_yadelivery_offer` (
	`ID` int(11) NOT NULL AUTO_INCREMENT,
	`OFFER_ID` varchar(50) NOT NULL,
	`PVZ_ID` varchar(50) DEFAULT NULL,
	`REQUEST_ID` varchar(50) DEFAULT NULL,
	`ORDER_ID` int(11) DEFAULT NULL,
	`ORDER_DATE` datetime DEFAULT NULL,
	`ADDRESS` varchar(255) NOT NULL,
	`LOCATION` varchar(20) NOT NULL,
	`DELIVERY_INTERVAL` varchar(100) DEFAULT NULL,
	`STATUS` varchar(50) DEFAULT NULL,
	`STATUS_DESCRIPTION` varchar(255) DEFAULT NULL,
	`JSON_REQUEST` TEXT,
	`JSON_RESPONS` TEXT,
	`PAYMENT` varchar(50) DEFAULT NULL,
	`PICKUPDATE` datetime DEFAULT NULL,
	`STATUSCONFIRM` tinyint(1) DEFAULT NULL,
	`PRICE` float DEFAULT NULL,
	`PRICE_FIX` float DEFAULT NULL,
	`PRICE_DELIVERY` float DEFAULT NULL,
	`CANCEL` tinyint(1) DEFAULT '0',
	`CHECK_AGENT` tinyint(1) DEFAULT '0',
	`PICKUP` varchar(100) DEFAULT NULL,
	`CREATE_ERROR` varchar(50) DEFAULT NULL,
	`BARCODE` varchar(50) DEFAULT NULL,
	`DIVIDE` varchar(50) DEFAULT '1',
	PRIMARY KEY (`ID`)
);

CREATE TABLE `b_twpx_yadelivery_offer_temp` (
	`ID` int(11) NOT NULL AUTO_INCREMENT,
	`ORDER_ID` int(11) NOT NULL,
	`ORDER_DATE` datetime DEFAULT NULL,
	`PVZ_ID` varchar(50) DEFAULT NULL,
	`PAYCONFIRM` tinyint(1) DEFAULT NULL,
	`PAYMENT` varchar(50) DEFAULT NULL,
	`LOCATION` varchar(256) DEFAULT NULL,
	`DELIVERY_INTERVAL` varchar(100) DEFAULT NULL,
	`DELIVERYDATE` datetime DEFAULT NULL,
	`INSURANCE` tinyint(1) DEFAULT NULL,
	PRIMARY KEY (`ID`)
);

CREATE TABLE IF NOT EXISTS `b_twpx_yadelivery_timezone`(
    `ID` INT(11) NOT NULL AUTO_INCREMENT,
    `BX_CODE` VARCHAR(20) DEFAULT NULL,
    `UTC` VARCHAR(10) DEFAULT NULL,
    `REGION` VARCHAR(255) DEFAULT NULL,
    PRIMARY KEY(`ID`)
);

